        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["datasetName", "actions"],
                "properties": {
                  "datasetName": {
                    "description": "The name of the data set.",
                    "type": "string",
