                    "minItems": 0,
                    "maxItems": 20
                  },
                  "retentionPeriod": {
                    "description": "How long, in days, message data is kept.",
                    "type": "object",
                    "properties": {
                      "unlimited": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/UnlimitedRetentionPeriod"
                          },
                          {
                            "description": "If true, message data is kept indefinitely."
